import React from 'react';
import Navbar from './Navbar';
import Images from './Images';

export default function Insurance(){
    return (
        <>
            <Navbar />
            <div className="container">
                <div className="row mt-4">
                    <div className="col-4">
                        <img src={Images.insurance_types} width="150%"/>
                    </div>
                </div>
            </div>
         </>
    );
}
